import React from "react";

export default function Conta({ user, onNavigate }) {
  return (
    <div className="account-page">
      <button className="btn ghost" onClick={() => onNavigate("dashboard")}>
        Voltar
      </button>

      <h2>CONTA</h2>

      <p>Olá, {user.username}</p>
      <p>{user.balance || 0} pts</p>

      <button className="btn">Depositar</button>
      <button className="btn">Sacar</button>
      <button className="btn ghost">Histórico</button>
    </div>
  );
}
